import React from 'react';
import {
  Container,
  Grid,
  List,
  ListItem,
  ListItemSecondaryAction,
  ListItemText,
  Switch
  } from '@material-ui/core';

import { privacyData } from '../data';
import { SliderItem, Status } from './Styles';

function WebProtectionProtectionPrivacyTracking(){
  return(
    <Container>
      <div className="LKOcontainer">
        <Status>{privacyData.length} trackers detected</Status>
      </div>
      <List className="LKOlist">
      {privacyData.map((item) => (
        <ListItem className="LKOlistitem" key={item.id}>
          <ListItemText primary={item.name} secondary={`${item.name} is a ${item.type}. This ${item.description}.`}/>
          <ListItemSecondaryAction>
            <Grid item>Detected</Grid>
            <Grid item>
              <Switch color="secondary" checked={item.blocked}/>
            </Grid>
            <Grid item>Blocked</Grid>
          </ListItemSecondaryAction>
        </ListItem>
      ))}
      </List>

    </Container>
  );
};

export default WebProtectionProtectionPrivacyTracking;
